const ImageRound = (props) => {
    return (
        <div>
            <div className="image">
                <img src={props.src} alt={props.alt} />
            </div>
            <style jsx>{`
                .image {
                    border-radius: 100%;
                    border: 1px solid;
                    height: 100px;
                    width: 100px;
                }
                img {
                    display: block;
                    border-radius: 100%;
                    max-width: 100%;
                    max-height: 100%;
                }
            `}</style>
        </div>
    )
}

export default ImageRound
